const Box=()=>{
    return (
        <div className="col-md-12 text-center mt-5">
            <div className="shadow rounded resultBox">
                <img className="weatherIcon" src="https://cdn.jim-nielsen.com/ios/1024/weather-2019-02-07.png" />

            <h5 className="Weathercity">Weather City</h5>
            <h6 className="Weathertemperature">Weather Temperature</h6>

            </div>
        </div>
    )
}

export default Box;
